import React from "react";
import Peak from "../Peak/Peak";
import s from "./PeakContainer.module.css";
import photos from "../../../public/14ers-photos";

const MountainContainer = ({ peakData }) => {


    return (
        <div className={s.peakContainer}>
            {
                peakData.length ? peakData.map((peak, i) => (
                    <Peak
                        key={peak.id}
                        peak={peak}
                        photo={photos[i]}
                    />
                ))
                : <div>Something went wrong. No peaks.</div>
            }

        </div>
    )
}

export default MountainContainer;
